Jeeva is a small-time criminal leading the life of a nonentity. His perchant for solitude is an outcome of his troubled past. The fresh breath of life is the bubbly girl next door, Kiran. While Kiran overtly tries to befriend Jeeva, the latter does not pay much heed to her advances. Till a gang of baddies kill Kiran's family. Kiran wants the criminals punished, but she loses the legal battle and the criminals are set free. Jeeva feels sorry for Kiran and before you know, he's fallen in love with her. From here on it is operation revenge for the two. Jeeva trains Kiran in handling weapons and warfare. In the final showdown, Jeeva will sacrifice his life to save Kiran's life. Written by gavin (&lt;a class=&quot;__cf_email__&quot; href=&quot;/cdn-cgi/l/email-protection&quot; data-cfemail=&quot;b6d1c3d8dbd7c5c2d3c4fbf6ded9c2dbd7dfda98d5d9db&quot;&gt;[email&amp;#160;protected]&lt;/a&gt;&lt;script cf-hash='f9e31' type=&quot;text/javascript&quot;&gt;
